#	===
#	Introduction
#	===
#
#	This is a full rewrite of dungeontreasurepath.js in Python, with its own CLI testing demo with ascii output
#	(though the dungeontreasurepath.js testing demo in dtp_demo.html outputs the results in HTML, and as such looks much nicer)
#
#	here's what dungeontreasurepath.js is about:
#
#	dungeontreasurepath.js is a small part of the offline processes which create database data for procedurally-generated maze-like maps for this game: https://dungeon.wyvernquest.com
#
#	Purpose:
#	This specific function is designed to backfill the shortest path from a treasure (called "lucre" in the code/variable shorthand) to the map's start point.  For data compression reasons, it returns that path as Moves (up, down, left or right), which are coded as 2-bit Binaries (00 = left, 01 = up, 10 = right, 11 = down).  This gives us a database footprint of a varbinary that will be at most (largest walking distance on the map)*2 bits.
#
#	Inputs:
#	It takes in the Start Position of the map, an array of treasures (whose Values are "_"-delimited lists, the first 2 items of which are the treasure's X-coordinate and Y-coordinate), and dsqseen (array of squares seen) which is a dictionary whose Keys are X+"_"+Y coordinates, and whose Values are the number of steps it takes to get to those coordinates from the map start point (not as-the-crow-flies, but the actual shortest number of steps needed to get through the maze from Start Position to that square).  dsqseen was populated by a recursive function during initial map generation, and we assume it to be accurate and well-formed; the function has checks and balances for malformed data:  it won't return useful answers, its failure would show up in its internal debugging message, and it won't run indefinitely.
#
#	Why this function exists:
#	dsqseen is no longer needed once the map generation is complete, so it is not part of moving the map into the game's database.  However we DO want to be able to display the optimal walking path between the start point and each treasure in the future.
#
#	How it works in general:
#	For each treasure, it looks up its starting X,Y position in dsqseen and sees the dsqseen Distance of that square. Then it looks left, up, down and right from its X,Y position, to find which of those adjacent squares exists in dsqseen* and is also one step less distant from the start position. If it finds such a square, it records that as the next step to take back towards the start position**. It then repeats that process for each new square until it reaches the start position (or dead-ends / takes more steps than should exist, because dsqseen is in some way broken or malformed).
#	*: if an X,Y coordinate does not exist in dsqseen, there's a wall there, and not a passable square.
#	**: because the answer we want is "how do I walk from the start to this treasure?", it records each decision "backwards": for example if this treasure's distance from the starting point is listed as 95 steps, and our first step from the treasure towards the start is to step Right, we report the 95th Step is Left, because that is what will take us from the 94th Step to the square we want to be on for the 95th Step.
#

##
##			The Function Being Demonstrated, as rewritten from scratch in Python:
##
def lucres_getbinpathfromdoor(lstartxy, llucres, dsqseen, showdebug):
	dlucre_binpaths = {}
	dlucre_dirpaths = {}
	ltpaths = []
	# [[ CODE SAMPLE NOTE ]]  in the original code, this array was returned from a function
	talldirs = ( (-1,0), (0,-1), (1,0), (0,1) )
	
	msg = 'Doing Show Lucre Paths:'
	for i in range( len(llucres) ):
		ll = llucres[i].split('_')
		lcur = ( int( ll[0] ), int( ll[1] ) )
		curjoin = str(lcur[0]) + '_' + str(lcur[1])
		firstdist = curdist = int(dsqseen[ curjoin ])
		tries = 0
		prob = False
		msg += '\nLucre ' + curjoin + ':  from ' + str(firstdist)
		## lmove = []
		movelist = '';
		while curdist > 0 and tries - 10 < firstdist:
			curjoin = str(lcur[0]) + '_' + str(lcur[1])
			thismsg = '\n' + curjoin + ', dist=' + str(curdist) +': '
			tries += 1
			thisdist = curdist
			# there will be ONE square stepable from acur whose asqseen is (curdist-1)
			for j in range( len(talldirs) ):
				lnew = [ lcur[0] + talldirs[j][0], lcur[1] + talldirs[j][1] ]
				newxy = str(lnew[0]) + '_' + str(lnew[1])
				## thismsg += '\n\t' + str(j) +'=' + newxy
				if newxy in dsqseen and int(dsqseen[newxy]) + 1 == curdist:
					lcur = [ lnew[0], lnew[1] ]
					curdist -= 1
					# now, to record the move that gets us to this square (the OPPOSITE of the move we did)
					## lmove[curdist] = (j + 2) % len(talldirs)
					movelist = str( (j + 2) % len(talldirs) ) + movelist
					break
			if thisdist == curdist:
				prob = True
				thismsg += '\nDEAD END at ' + curjoin
				msg += thismsg
				break
		# end while-loop for 1 lucre
		if not prob:
			msg += ' Success, ' + str(len(movelist)) + ' steps {' + movelist +'}' ## + lmove.join(', ')
			dlucre_dirpaths[llucres[i]] = movelist
		msg += '\n---';
	# end lucre-loop
	
	# now we want to translate 0-3 move directions into binary paths:
	msg += '\nPARSING:'
	for xy in dlucre_dirpaths:
		bp = ''
		msg += '\n' + xy + '`s string of dirs=' + str( len(dlucre_dirpaths[xy]) ) + '\n'
		for i in range( len(dlucre_dirpaths[xy]) ):
			# add encoded to string:
			msg += ' p' + str(i) +'=' + dlucre_dirpaths[xy][i:i+1]
			newb = lucredir_encodetobin( int(dlucre_dirpaths[xy][i:i+1]) )
			msg += '->' + newb
			bp += newb
		dlucre_binpaths[xy] = bp
	
	if showdebug: print(msg)

	return dlucre_binpaths



