def test_code():
	msg = ''
	num = input('Enter the number of the map you\'d like to see (between 1 and 8) ')
	if not num.isnumeric() or int(num) < 1 or int(num) > 8:
		msg += '(Invalid input, we\'ll do Map #1)\n\n'
		num = 1
	else:
		num = int(num)

	[lstartxy, llucres, dsqseen, ldim] = get_test_data(num)

	showdebug = False

	llxb = lucres_getbinpathfromdoor(lstartxy, llucres, dsqseen, showdebug)

	mapy = show_whole_map(ldim, lstartxy, llucres, llxb, dsqseen)

	msg += '======\nMap #' + str(num) + '\n======\nresults for ' +str( len(llxb) )+ ' lucres:\n'
	if showdebug: msg = '\n------\n\n' + msg
	msg += '\nSomewhat Readable output:\n---------'
	for l in llxb:
		msg += '\n' + somewhatreadable_lucreandbinpath(l, llxb[l]) + '\n'
	msg += '\n\n-----\n\nMap:\n----\n' + mapy

	print(msg)



def somewhatreadable_lucreandbinpath(lucre, binpath):
	s = ''
	llucre = lucre.split('_')
	s += llucre[ len(llucre) - 1] + ': at ' + str(llucre[0]) +'x'+ str(llucre[1]) + ', ' + str( int(len(binpath) / 2) ) + ' steps: '
	dbinxdir = { '00':'L', '01':'U', '10':'R', '11':'D' }
	for pos in range(0, len(binpath), 2):
		binstep = binpath[pos:pos + 2]
		if binstep in dbinxdir:
			s += ' ' + dbinxdir[binstep]
		else:
			break
	return s


def show_whole_map(ldim, lstartxy, llucres, llucrexbinpath, dsqseen):
	m = ''
	startxy = str(lstartxy[0]) +'_'+ str(lstartxy[1])
	dlucrexy = {}
	dlucrepath = {}
	llucrebins = []
	for lstr in llucres:
		llucre = lstr.split('_')
		curlucrexy = llucre[0]+'_'+llucre[1]
		dlucrexy[ curlucrexy ] = 1  # this xy is a lucre location
		## rack up the binaries for future creation of 'stepped here' lucre list:
		llucrebins.append( llucrexbinpath[ lstr ] )
	
	#	this creates a dictionary whose KEYS are X_Y coordinates,
	#	and whose VALUES are '# of times paths passed through that square'
	#	(in case we care about path overlap)
	dlucrestepped = create_collective_dlucrestepped(lstartxy, llucrebins)		
		
	for y in range( ldim[1] ):
		m += '\n'
		for x in range( ldim[0] ):
			s = ' '
			newxy = str(x) +'_'+ str(y)
			if newxy in dsqseen:
				s = '-'
				if newxy == startxy:
					s = '@'
				elif newxy in dlucrexy:
					s = 'X'
				elif newxy in dlucrestepped:
					s = '+'
			m += s

	m += '\n\n====\nMap Legend:\n@ = Map Entry Point\tX = Treasure\t+ = Walkable square that IS part of a shortest path\t- = Walkable Square that is NOT part of any shortest path'

	return m



def create_collective_dlucrestepped(lstartxy, llucrebins):
	# given a list of binary descriptions of how to walk from start to treasure,
	# this returns a dictionary whose KEYS are X_Y coordinates, and whose VALUES are '# of times paths moved through that square'
	# (X_Y coordinates which do not appear in this dictionary were not stepped in during paths-to-lucres)
	dls = {}
	dmove = {
			'00':[-1,0],
			'01':[0,-1],
			'10':[1,0],
			'11':[0,1]
	}
	msg = ''
	for i in range( len(llucrebins) ):
		msg += '\nPath ' +str(i)+', steps=' +str( len(llucrebins[i]) / 2 ) + ':\n'
		# start at xy:
		lcurxy = [lstartxy[0], lstartxy[1]]
		# walk:
		for pos in range(0, len(llucrebins[i]), 2):
			binstep = llucrebins[i][pos:pos + 2]
			msg += ' ' +binstep+ '='
			if binstep in dmove:
				lcurxy[0] += dmove[binstep][0]
				lcurxy[1] += dmove[binstep][1]
				curxy = str(lcurxy[0]) +'_'+ str(lcurxy[1])
				msg += curxy
				if curxy not in dls:
					dls[curxy] = 1  # first time we've stepped somewhere, we set it to one
				else:
					dls[curxy] += 1  # subsequent times we increment it
			else:
				msg += '!!!'
				break

	# (if you wanted to debug this process)
	## print(msg)

	return dls



